description:
30 Rock episode 7 - &quot;Tracy Does Conan&quot;

Jack bumps Jenna&amp;#039;s scheduled appearance on Late Night with Conan O&amp;#039;Brien and puts Tracy on in her place. To make matters worse, Tracy has gone off his medication and he is consequently acting more erratic than ever. Jack encourages bald producer Pete Hornberger to wear a wig. 

Air date - December 7, 2006
